using System;
using System.IO;
using System.Threading.Tasks;
using Microsoft.AspNetCore.Mvc;
using Microsoft.Azure.WebJobs;
using Microsoft.Azure.WebJobs.Extensions.Http;
using Microsoft.AspNetCore.Http;
using Microsoft.Extensions.Logging;
using PdfSharp.Pdf.IO;

namespace Personal.PdfApp
{
    public class EditPdf
    {
        [FunctionName("EditPdf")]
        public async Task<IActionResult> RunAsync(
            [HttpTrigger(AuthorizationLevel.Function, "get", Route = null)]
            HttpRequest req, ILogger log)
        {
            System.Text.Encoding.RegisterProvider(System.Text.CodePagesEncodingProvider.Instance);
            log.LogInformation("C# HTTP trigger function processed a request.");
            
            var pdfBytes = Convert.FromBase64String(base64File);
            await using var memoryStream = new MemoryStream(pdfBytes);
            await using var outStream = new MemoryStream();
            {
                var doc = PdfReader.Open(memoryStream, PdfDocumentOpenMode.Import);
                doc.AddPage();
                doc.Save(outStream);
                return new FileContentResult(outStream.ToArray(), "application/pdf");
            }
        }
        
        private readonly string base64File = "";
    }
}